$(function(){
	var options	= {
	max	: 5,
	title_format	: function(value) {
		var title = '';
		switch (value) {
			case 1 : 
				title	= '';
				break;
			case 2 : 
				title	= '';
				break;
			case 3 : 
				title	= '';
				break;
			case 4 : 
				title	= '';
				break;
			case 5 : 
				title	= '';
				break;
			default :
				title = value;
				break;
		}
		return title;
	},
	info_format	: function(value) {
		var info = '';
		switch (value) {
			case 1 : 
				info	= '<div class="info-box">1&nbsp;<div></div></div>';
				break;
			case 2 : 
				info	= '<div class="info-box">2&nbsp;<div></div></div>';
				break;
			case 3 : 
				info	= '<div class="info-box">3&nbsp;<div></div></div>';
				break;
			case 4 : 
				info	= '<div class="info-box">4&nbsp;<div></div></div>';
				break;
			case 5 : 
				info	= '<div class="info-box">5&nbsp;<div></div></div>';
				break;
			default :
				info = value;
				break;
		}
			return info;
		}
	}
	$('#rate-comm-1').rater(options);
});
