var pageNav = pageNav || {};
pageNav.fn = null;
//p,pn
pageNav.nav = function(p, pn) {
    //,1
    if (pn <= 1) {
        this.p = 1;
        this.pn = 1;
        return this.pHtml2(1);
    }
    if (pn < p) {
        p = pn;
    };
    var re = "";
    //
    if (p <= 1) {
        p = 1;
    } else {
        //
        re += this.pHtml(p - 1, pn, "&lt;");
        //
        re += this.pHtml(1, pn, "1");
    }
    //
    this.p = p;
    this.pn = pn;

    //
    var start = 2;
    var end = (pn < 6) ? pn: 6;
    //,10
    if (p >= 5) {
        re += "<span class='mor'>...</span>";
        start = p - 2;
        var e = p + 2;
        end = (pn < e) ? pn: e;
    }
    for (var i = start; i < p; i++) {
        re += this.pHtml(i, pn);
    };
    re += this.pHtml2(p);
    for (var i = p + 1; i <= end; i++) {
        re += this.pHtml(i, pn);
    };
    if (end < pn) {
        re += "<span class='mor'>...</span>";
        //,
        re += this.pHtml(pn, pn);
    };
    if (p < pn) {
        re += this.pHtml(p + 1, pn, "&gt;");
    };
    return re;
};
//
pageNav.pHtml = function(pageNo, pn, showPageNo) {
    showPageNo = showPageNo || pageNo;
    var H = " <a href='javascript:pageNav.go(" + pageNo + "," + pn + ");' class='pageNum'>" + showPageNo + "</a> ";
    return H;

};
//
pageNav.pHtml2 = function(pageNo) {
    var H = " <b>" + pageNo + "</b> ";
    return H;
};
//,
pageNav.go = function(p, pn) {
    //$("#pageNav").html(this.nav(p,pn)); //jQuery
    document.getElementById("pageNav").innerHTML = this.nav(p, pn);
    if (this.fn != null) {
        this.fn(this.p, this.pn);
    };
};
